OK, here's a minimal version:

main.js:

``` js
const { session, protocol, app, BrowserWindow, Menu, shell } = require('electron');

const path = require('path')
const URL = require('url');


let menu;
let template;
let mainWindow = null;


if (process.env.NODE_ENV === 'development') {
    require('electron-debug')(); // eslint-disable-line global-require
}

app.on('window-all-closed', () => {
    if (process.platform !== 'darwin') app.quit();
});


//protocol.registerStandardSchemes(['ask'])

app.on('ready', () => {

  protocol.registerFileProtocol('ask', (request, callback) => {
      let url = URL.parse(request.url)
      let filename = url.pathname
      if (url.pathname == '/') {
        filename = 'index.html'
      }
      console.log("Req:", request, path.normalize(`${__dirname}/${filename}`))
      callback({ path:  path.normalize(`${__dirname}/${filename}`) })
  }, (error) => {
      if (error) console.error('Failed to register protocol')
  })

  protocol.registerServiceWorkerSchemes(['ask'])

    mainWindow = new BrowserWindow({
        show: false,
        width: 1400,
        height: 900,
        webPreferences: {
          // https://github.com/electron/electron/issues/7183
         partition: 'persistent:ask',
        }
    });

    mainWindow.loadURL('ask://root/');
    //mainWindow.loadURL(`https://gt`);

    mainWindow.webContents.on('did-finish-load', () => {
        mainWindow.show();
        mainWindow.focus();
    });

    mainWindow.on('closed', () => {
        mainWindow = null;
    });

});
```

index.html: 

```
<h1>Hello world </h1>
```

Running this without the `partition` key results in the hello world window.

Note: electron actually emits a failed-provisional-load error: 
app.on("did-fail-provisional-load", (error_code, error_description, url) => {
  console.error('Failed provisional load:', error_code, error_description, url)
})

The problem is you have registered the protocol handler to the default partition but loading the window in a different partition, hence the url doesn't load.

```
const { session, protocol, app, BrowserWindow, Menu, shell } = require('electron');

const path = require('path')
const URL = require('url');


let menu;
let template;
let mainWindow = null;


if (process.env.NODE_ENV === 'development') {
    require('electron-debug')(); // eslint-disable-line global-require
}

app.on('window-all-closed', () => {
    if (process.platform !== 'darwin') app.quit();
});


//protocol.registerStandardSchemes(['ask'])

app.on('ready', () => {
  const partition = 'persistent:ask'
  const ses = session.fromPartition(partition)

  ses.protocol.registerFileProtocol('ask', (request, callback) => {
      let url = URL.parse(request.url)
      let filename = url.pathname
      if (url.pathname == '/') {
        filename = 'index.html'
      }
      console.log("Req:", request, path.normalize(`${__dirname}/${filename}`))
      callback({ path:  path.normalize(`${__dirname}/${filename}`) })
  }, (error) => {
      if (error) console.error('Failed to register protocol')
  })

  protocol.registerServiceWorkerSchemes(['ask'])

    mainWindow = new BrowserWindow({
        show: false,
        width: 1400,
        height: 900,
        webPreferences: {
          // https://github.com/electron/electron/issues/7183
         partition: partition,
        }
    });

    mainWindow.loadURL('ask://root/');
    //mainWindow.loadURL(`https://gt`);

    mainWindow.webContents.on('did-finish-load', () => {
        mainWindow.show();
        mainWindow.focus();
    });

    mainWindow.on('closed', () => {
        mainWindow = null;
    });

});
```

Also for persistent partitions should use `persist:<partition_name>` not `persistent:`. Closing this out since its not a bug in Electron.
